// frontend/src/pages/Home.js
import React from 'react';
import { useNavigate } from 'react-router-dom';
import './Home.css';

const Home = ({ user, setUser }) => {
  const navigate = useNavigate();

  const handleRequestTurno = () => {
    if (!user) {
      alert('Por favor, inicia sesión para pedir un turno.');
      navigate('/login');
    } else {
      navigate('/pedir-turno');
    }
  };

  const safeUserName = user && typeof user === 'object' ? user.nombre || 'Usuario' : 'Usuario';

  return (
    <div className="home-page">
      <div className="home-container">
        {/* Header */}
        <header className="home-header">
        <h2 className="home-title">Hola, {safeUserName}, ya es hora de pedir tu turno</h2>
          <p className="home-subtitle">
            Gestiona tus turnos de manera rápida y sencilla
          </p>
          <button className="home-cta-button" onClick={handleRequestTurno}>
            Pedir un Turno
          </button>
        </header>

        {/* Quiénes Somos */}
        <section className="home-section">
          <h2 className="home-section-title">Quiénes Somos</h2>
          <p className="home-text">
            Lorem ipsum dolor sit amet, consectetur adipiscing elit. Sed do eiusmod tempor incididunt ut labore et dolore magna aliqua. Ut enim ad minim veniam, quis nostrud exercitation ullamco laboris nisi ut aliquip ex ea commodo consequat.
          </p>
        </section>

        {/* Servicios */}
        <section className="home-section">
          <h2 className="home-section-title">Nuestros Servicios</h2>
          <div className="home-cards-container">
            <div className="home-card">
              <h3 className="home-card-title">Turnos en Línea</h3>
              <p className="home-card-text">
                Lorem ipsum dolor sit amet, consectetur adipiscing elit. Duis aute irure dolor in reprehenderit in voluptate velit esse cillum dolore.
              </p>
            </div>
            <div className="home-card">
              <h3 className="home-card-title">Atención Personalizada</h3>
              <p className="home-card-text">
                Lorem ipsum dolor sit amet, consectetur adipiscing elit. Excepteur sint occaecat cupidatat non proident, sunt in culpa qui officia.
              </p>
            </div>
            <div className="home-card">
              <h3 className="home-card-title">Soporte 24/7</h3>
              <p className="home-card-text">
                Lorem ipsum dolor sit amet, consectetur adipiscing elit. Ut enim ad minim veniam, quis nostrud exercitation ullamco laboris.
              </p>
            </div>
          </div>
        </section>

        {/* Cómo Funciona */}
        <section className="home-section">
          <h2 className="home-section-title">Cómo Funciona</h2>
          <div className="home-steps-container">
            <div className="home-step">
              <span className="home-step-number">1</span>
              <p className="home-step-text">
                Regístrate o inicia sesión con tu cuenta.
              </p>
            </div>
            <div className="home-step">
              <span className="home-step-number">2</span>
              <p className="home-step-text">
                Selecciona el servicio y horario que prefieres.
              </p>
            </div>
            <div className="home-step">
              <span className="home-step-number">3</span>
              <p className="home-step-text">
                Confirma tu turno y recíbelo en tu correo.
              </p>
            </div>
          </div>
        </section>
      </div>
    </div>
  );
};

export default Home;
